import PropTypes from 'prop-types';
import styled from 'styled-components';
import Header from './Header';
import Nav from './Nav';

export default function Page({ children }) {
  return (
    <div>
      <Header />
      <Nav />
      {children}
    </div>
  );
}

Page.propTypes = {
  children: PropTypes.any,
};
